import React from "react";
import ReactDOM from "react-dom/client";
import "./style.css";
const root=ReactDOM.createRoot(document.getElementById("root"));
function Navbar() {
return(
  <nav>
    <h1>Perfumy</h1>
   <ul>
    <li>home |</li>
    <li>product |</li>
    <li>about |</li>
    <li>contact |</li>
   </ul>
  </nav>
);
}
function Search() {
  return(
    <div class="">
    <input type="text" placeholder="Search"/>
    </div>
  );
}



root.render(
<div>
<Navbar></Navbar>
<Search></Search>
</div>
);
